// App.js
import React from 'react';
import "../styles/pages/careers.scss";


  const App = () => {
	return(
		<div>
		<div className="semi-donut margin" 
     style="--percentage : 80; --fill: #FF3D00 ;">
  HTML5
</div>
		<div className="semi-donut-model-2 margin"
     style="--percentage : 90; --fill: #039BE5 ;">
  CSS3
</div>
		<div className="multi-graph margin">
  JavaScript
  <div className="graph" data-name="jQuery" 
       style="--percentage : 80; --fill: #0669AD ;">
  </div>
  <div className="graph" data-name="Angular" 
       style="--percentage : 60; --fill: #E62A39 ;">
  </div>
  <div className="graph" data-name="React" 
       style="--percentage : 30; --fill: #FEDA3E ;">
  </div>
</div>
	  </div>
	)
	};


export default App;
